    return(

        <div className="column is-one-fifth main-view-categories ">
            <p>Kategorie</p>
            <ul>
                <li><a href="" className="main-view-categories-item">Biologia</a></li>
                <li><a href="" className="main-view-categories-item">Chemia</a></li>
                <li><a href="" className="main-view-categories-item">Język angielski</a></li>
                <li><a href="" className="main-view-categories-item">Język niemiecki</a></li>
            </ul>
        </div>

    )
}
export default SideMenuNauka
